class App extends Component {
  constructor(props) {
    super(props);
    this.setPage.bind(this);

    this.state = {
      token: localStorage.getItem("token"),
      page: null,
    };
  }

  componentDidMount() {
    // this.setPage(<Home setPage={this.setPage} token={this.state.token} />);
